module_description: The mongo shell is a the v8 javascript interpreter with bindings
    into the C++ driver.  This is used to run javascript tests against the server
module_groups:
-   group_description: C++ files that are automatically generated from the Javascript
        source files. This means that certain Javascript files work in the shell because
        they are actually compiled in, which means that sometimes the server needs
        to be recompiled to see changes in Javascript files
